import React from 'react';


function SkillTag({ skill }) {
  return (
    <span className="overflow-hidden gap-2.5 self-stretch px-3 py-1 text-black bg-zinc-100 rounded-[30px]">
      {skill}
    </span>
  );
}

export default SkillTag;
